DROP TABLE IF EXISTS `NEW_USER_CARRIER_DAY`;
CREATE TABLE `NEW_USER_CARRIER_DAY` (
  `ID` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `SERVERID` varchar(200) NOT NULL COMMENT '服务器标识 : 用于标识服务器，以及不同的收集源',
  `LOG_TYPE` varchar(50) NOT NULL COMMENT '日志收集类型 : 包括：Android，IOS，WinPhone，WepAPP等',
  `APP_KEY` varchar(200) NOT NULL COMMENT 'APP唯一标识 : 生成应用唯一标识UUID',
  `APP_VERSION` varchar(20) NOT NULL COMMENT 'APP版本号 : 应用版本信息',
  `CARRIER` varchar(200) NOT NULL COMMENT '运营商 : 运营商标识：\r\n中国移动/中国联通/中国电信/其它',
  `NEW_USER` int(11) NOT NULL COMMENT '汇总新增用户',
  `STATISTICS_DATE` date NOT NULL COMMENT '统计日期 : 统计日期',
  `AFFILIATED_ORG` varchar(200) DEFAULT NULL COMMENT '隶属组织机构',
  `AFFILIATED_REGION` varchar(200) DEFAULT NULL COMMENT '隶属行政地区',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `ID` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='新增用户运营商';

