-- ----------------------------
--  Table structure for `ResearchReport`
-- ----------------------------
DROP TABLE IF EXISTS `ResearchReport`;
CREATE TABLE `ResearchReport` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` datetime DEFAULT NULL,
  `userTotal` int(11) DEFAULT '0' COMMENT '用户总数',
  `activeUserTotal` int(11) DEFAULT '0' COMMENT '活跃用户总数',
  `userRetainedTotal` int(11) DEFAULT '0' COMMENT '/*用户留存总量*/',
  `activeUserRetainedTotal` int(11) DEFAULT '0' COMMENT '/*活跃用户留存总量*/',
  `applicationExceTotal` int(11) DEFAULT '0' COMMENT '/*应用异常总数*/',
  `applicationStartTotal` int(11) DEFAULT '0' COMMENT '/*应用启动总次数*/',
  `pageExceTotal` int(11) DEFAULT '0' COMMENT '/*页面异常总数*/',
  `pageVisitTotal` int(11) DEFAULT '0' COMMENT '/*页面访问总数*/',
  `userCommentsTotal` int(11) DEFAULT '0' COMMENT '/*用户评论总数*/',
  `userPraiseTotal` int(11) DEFAULT '0' COMMENT '*用户好评总数*/',
  `visitTotal` int(11) DEFAULT '0' COMMENT '/*用户访问评论模块总数*/',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

