-- ----------------------------
--  Table structure for `STATIC_GROUP`
-- ----------------------------
DROP TABLE IF EXISTS `STATIC_GROUP`;
CREATE TABLE `STATIC_GROUP` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '群组 名称',
  `total` bigint(20) NOT NULL COMMENT '符合该群条件的总用户数',
  `status` int(11) NOT NULL COMMENT '表示该群的状态 0 表示处理中   1 表示已经完成',
  `user_type` int(11) NOT NULL COMMENT '表示统计用户的范围（0：表示新增用户   1：表示活跃用户）',
  `start_time` date NOT NULL COMMENT '按照user_type 等条件进行查询的开始时间',
  `end_time` date NOT NULL COMMENT '按照user_type 等条件进行查询的结束时间',
  `user_province` varchar(30) DEFAULT NULL COMMENT '表示可以按照用户的所在省份进行查询',
  `user_sex` int(11) DEFAULT NULL COMMENT '表示可以按照用户的性别进行查询 0表示男生  1表示女生',
  `user_min_age` int(11) DEFAULT NULL COMMENT '表示可以 统计用户年龄范围的最小年龄',
  `user_max_age` int(11) DEFAULT NULL COMMENT '表示可以 统计用户年龄范围的最大年龄',
  `user_channel` varchar(255) DEFAULT NULL COMMENT '表示可以按照用户渠道信息进行筛选',
  `user_device` varchar(255) DEFAULT NULL COMMENT '可以按照用户的设备型号进行查询 筛选',
  `updateTime` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

